import React, { useState } from "react";

const Cell = (props) => {
    const [clicked, setClicked] = useState(false);
    const [bgColor, setBgColor] = useState("#ffffff2e");

    let max = 36;
    let min = 1;
    let value = Math.floor(Math.random() * (max - min) + min);

    const handleClick = () => {
        setClicked(!clicked);
        if (clicked) {
            setBgColor("#ffffff6d");
        } else {
            setBgColor("#ffffff2e");
        }
    };

    return (
        <th onClick={handleClick} style={{ backgroundColor: bgColor }}>
            {value}
        </th>
    );
};

export default Cell;
